import React from 'react'

class Search extends React.Component {
    render() {
        return (
            <div>
                <div class="search">
                    <label for="search-bar">Search :</label>
                    <input type='text' name='search-bar' placeholder='Search your query here'></input>
                </div>
            </div>
        )
    }

}

export default Search
